import React from 'react'
import { animate, motion } from 'framer-motion'
import { type } from '@testing-library/user-event/dist/type'
import Img from '../../Assets/Img.svg'
import video1 from '../../video/'

const parentVariants = {
    hidden: {
         y:"-100vw"
    },
    visible:{
        y:"0" ,
        transition: {
            duration: 1.5,
        } 
    }
}

const childVariant = {
    hidden: {
        y:"100vw",
        opacity:0
    },
    visible:{
        y:"0" ,
        opacity:1,
        transition: {
            type: "spring",
            delay:5.5,
            duration: 2.5,
        } 
    }
}

function RightSide() {
  return (
    <motion.div className='w-1/2  bg-gradient-to-b from-blue-950 to to-blue-400'
        variants={parentVariants}
        initial ="hidden"
        animate = "visible"
    >
        <motion.div className='flex flex-col  h-full items-center justify-center'>
        <video src={video1} />  


        </motion.div>

    </motion.div>
  )
}

export default RightSide
